import React, { useEffect } from "react";
import { useDispatch , useSelector } from "react-redux";


const SearchPoke = () => {

    let poke = useSelector(obj => obj.pokemon)

    useEffect(()=> console.log(poke) , [])

    return (
        <div>
            {poke.name}
        </div>
    )
}

export default SearchPoke;
